void printResults(const int distance, int *pOutBuffer, unsigned char* pMap, const int width, const int height) {
  cout << "distance: " << distance << "\n";
  for (int i = 0; i < distance; i++)
    cout << "->" << pOutBuffer[i];
  cout << "\n";
  for (int i=0; i< height; i++ ) {
  for (int j=0; j< width; j++ ) {
    if (pMap[i*width+j] == 0) {
      cout << "o";
    }
    if (pMap[i*width+j] == 1) {
      cout << ".";
    }
    if (pMap[i*width+j] == 2) {
      cout << "+";
    }
    if (pMap[i*width+j] == 3) {
      cout << "k";
    }
  }
  cout << "\n";
  }
  cout << "---\n";
  for(int i=0; i< distance; i++){
    pMap[pOutBuffer[i]] = 2;
  }
  for (int i=0; i< height; i++ ) {
  for (int j=0; j< width; j++ ) {
    if (pMap[i*width+j] == 0) {
      cout << "o";
    }
    if (pMap[i*width+j] == 1) {
      cout << ".";
    }
    if (pMap[i*width+j] == 2) {
      cout << "+";
    }
    if (pMap[i*width+j] == 3) {
      cout << "k";
    }
  }
  cout << "\n";
  }
  return;
}

